import React from 'react';
import { connect } from 'react-redux'
import { newNote } from '../actions/notes'
import Notes from "./Notes";

class NotesContainer extends React.Component {
  static getDerivedStateFromProps(props) {
    if (props.notes.length === 0) 
      props.newNote({ id:0, title: "First Note", content: "Hello World"});
      return {};
  }

  render() {
    return <Notes {...this.props} />;
  }
}


const mapDispatchToProps = dispatch => ({
  newNote: note => dispatch(newNote(note)),
})

export default connect(state => state, mapDispatchToProps)(NotesContainer);
